import React from 'react';
import ''
import './App.css';


function LangList(props) {
  return (
    <div>
      <ul>
        {props.list.map((e) =>
          <li> {e} </li>
        )}
      </ul>
    </div>
  )
}


class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
       list: ['Paython', 'Javascript', 'Ruby']
    }
  }

  render() {
    return <LangList list={this.state.list} />
  }
}

export default App;
